import {getSellerDetails} from '../../service/SellerAccountService'
export default{
    name:"SellerAccountComponent",
    data()
    {
    return{
        sellerDetail:[],
        editButton:false,
    }
    },
    mounted()
    {
        getSellerDetails({
            success: ({ data }) => {
                console.log(data)

                this.sellerDetail=data.data

            },
            error: (e) => {

                console.warn(e);
            }
        })
    }
}
